const onwReducer = (state = {}, action) => {
    switch (action.payload) {
        case 'ADD_TASK_OWN':
            state = state.concat(action.payload);
            break;
        case 'DELETE_TASK_OWN':
            state = state.slice();  
            state.splice(action.payload, 1);
            break;
        default:
            return state;
    }
}

export default onwReducer;
